"""
LVGL Example 1: Basic Widget Demonstration

This example demonstrates:
- LVGL initialization for different platforms (SDL, ESP32, STM32)
- Basic widget creation (button, label, image)
- Event handling
- Style application
- Loading images from binary data

Supported platforms:
- Unix port with SDL
- ESP32 with ILI9341 display
- STM32 with built-in display
"""

import usys as sys
sys.path.append('') # See: https://github.com/micropython/micropython/issues/6419

import lvgl as lv
import lv_utils

lv.init()


class driver:
    def init_gui_SDL(self):
        self.event_loop = lv_utils.event_loop()
        self.disp_drv = lv.sdl_window_create(480, 320)
        self.indev_drv = lv.sdl_mouse_create()

    def init_gui_esp32(self):

        from ili9XXX import ili9341

        # Initialize ILI9341 display

        self.disp = ili9341(mhz=20, dc=32, cs=33, power=-1, backlight=-1, hybrid=False, factor=8)
        self.disp.init()

        # Register raw resistive touch driver

        import rtch

        touch = rtch.touch(xp=32, yp=33, xm=25, ym=26, touch_rail=27, touch_sense=33)
        touch.init()
        self.indev_drv = lv.indev_create()
        self.indev_drv.set_type(lv.INDEV_TYPE.POINTER)
        self.indev_drv.set_read_cb(touch.read)

    def init_gui_stm32(self):
        import rk043fn48h as lcd

        hres = 480
        vres = 272
        color_format = lv.COLOR_FORMAT.RGB8888

        # Register display driver
        event_loop = lv_utils.event_loop()
        lcd.init(w=hres, h=vres)
        
        buf1 = lcd.framebuffer(1)
        buf2 = lcd.framebuffer(2)
        
        self.disp_drv = lv.display_create(hres, vres)
        self.disp_drv.set_flush_cb(lcd.flush)
        self.disp_drv.set_color_format(color_format)
        self.disp_drv.set_buffers(buf1, buf2, len(buf1), lv.DISPLAY_RENDER_MODE.PARTIAL)

        # disp_drv.gpu_blend_cb = lcd.gpu_blend
        # disp_drv.gpu_fill_cb = lcd.gpu_fill

        # Register touch sensor
        self.indev_drv = lv.indev_create()
        self.indev_drv.set_type(lv.INDEV_TYPE.POINTER)
        self.indev_drv.set_read_cb(lcd.ts_read)

    def init_gui(self):

        # Identify platform and initialize it

        try:
            self.init_gui_esp32()
        except ImportError:
            pass

        try:
            self.init_gui_SDL()
        except ImportError:
            pass

        try:
            self.init_gui_stm32()
        except ImportError:
            pass


if not lv_utils.event_loop.is_running():
    drv = driver()
    drv.init_gui()

